CREATE OR REPLACE FUNCTION public.null_fields( p_schema TEXT, p_nullable TEXT ) RETURNS VOID AS
$$
	DECLARE
		v_row record;
		v_query text;
		v_exists boolean;
	BEGIN
		-- INFO: on pourrait ajouter un LIMIT en paramètres
		v_query := 'SELECT table_name, column_name FROM information_schema.columns WHERE table_schema = ''' || p_schema || ''' AND is_nullable = ''' || p_nullable || ''' AND LOWER( data_type ) IN ( ''character'', ''text'', ''character varying'', ''user-defined'' ) ORDER BY table_name, column_name;';
		FOR v_row IN EXECUTE v_query
		LOOP
			v_query := 'SELECT EXISTS( SELECT * FROM "' || v_row.table_name || '" WHERE TRIM( BOTH '' '' FROM "' || v_row.column_name || '"::TEXT ) = '''' );';
			--RAISE NOTICE  '%', v_query;

			EXECUTE v_query INTO v_exists;
			--RAISE NOTICE  '%', v_exists;

			RAISE NOTICE  '%: %', v_exists, v_query;

			IF p_nullable = 'NO' AND v_exists THEN
				RAISE NOTICE  'ATTENTION: %.% contient des valeurs vides (champ NOT NULL)', v_row.table_name, v_row.column_name;
			ELSIF p_nullable = 'YES' THEN
				RAISE NOTICE  'UPDATE "%" SET "%" = NULL WHERE TRIM( BOTH '' '' FROM "%"::TEXT ) = '''';', v_row.table_name, v_row.column_name, v_row.column_name;
			END IF;
		END LOOP;
	END;
$$
LANGUAGE plpgsql VOLATILE;

COMMENT ON FUNCTION public.null_fields( p_schema TEXT, p_nullable TEXT ) IS 'Recherche pour un schéma donné, des champs de type "texte" contenant une chaîne vide et pouvant (ou pas) être mis à NULL.';

